import React from'react'

import ReactThree from './../src/Assests/Images/ReactThree.png'
function Services()
{
    var sai = [
       
        { 
            id:234,
            name:'Siva',
          },
          { 
            id:235,
            name:'Variables',
          },
          { 
            id:236,
            name:'Modules',
          },
          { 
            id:237,
            name:'React',
          }
    ]
    return( 
    <div>
        <h1 className='hed'> Service Component</h1>
        <img src={ReactThree}  alt='' className='pic'/>
        {sai.map((res,i)=> {
              return(
                  <ul key={i}>
                      <li>{res.id}</li>
                      <li>{res.name}</li>
                  </ul>
              )}
        
        )}
   </div> 
   )
}

export default Services
